CREATE TABLE mytable(
   id                                    INTEGER  NOT NULL PRIMARY KEY 
  ,iso_code                              VARCHAR(8) NOT NULL
  ,continent                             VARCHAR(13)
  ,location                              VARCHAR(32) NOT NULL
  ,date                                  DATE  NOT NULL
  ,total_cases                           INTEGER 
  ,new_cases                             INTEGER 
  ,new_cases_smoothed                    NUMERIC(10,3)
  ,total_deaths                          INTEGER 
  ,new_deaths                            INTEGER 
  ,new_deaths_smoothed                   NUMERIC(8,3)
  ,total_cases_per_million               NUMERIC(10,3)
  ,new_cases_per_million                 NUMERIC(7,3)
  ,new_cases_smoothed_per_million        NUMERIC(7,3)
  ,total_deaths_per_million              NUMERIC(8,3)
  ,new_deaths_per_million                NUMERIC(6,3)
  ,new_deaths_smoothed_per_million       NUMERIC(6,3)
  ,reproduction_rate                     NUMERIC(4,2)
  ,icu_patients                          INTEGER 
  ,icu_patients_per_million              NUMERIC(5,3)
  ,hosp_patients                         INTEGER 
  ,hosp_patients_per_million             NUMERIC(5,3)
  ,weekly_icu_admissions                 VARCHAR(30)
  ,weekly_icu_admissions_per_million     VARCHAR(30)
  ,weekly_hosp_admissions                VARCHAR(30)
  ,weekly_hosp_admissions_per_million    VARCHAR(30)
  ,new_tests                             INTEGER 
  ,total_tests                           INTEGER 
  ,total_tests_per_thousand              NUMERIC(8,3)
  ,new_tests_per_thousand                NUMERIC(5,3)
  ,new_tests_smoothed                    INTEGER 
  ,new_tests_smoothed_per_thousand       NUMERIC(5,3)
  ,positive_rate                         NUMERIC(5,3)
  ,tests_per_case                        NUMERIC(4,1)
  ,tests_units                           VARCHAR(15)
  ,total_vaccinations                    INTEGER 
  ,people_vaccinated                     INTEGER 
  ,people_fully_vaccinated               INTEGER 
  ,new_vaccinations                      INTEGER 
  ,new_vaccinations_smoothed             INTEGER 
  ,total_vaccinations_per_hundred        NUMERIC(6,2)
  ,people_vaccinated_per_hundred         NUMERIC(6,2)
  ,people_fully_vaccinated_per_hundred   NUMERIC(6,2)
  ,new_vaccinations_smoothed_per_million INTEGER 
  ,stringency_index                      NUMERIC(5,2)
  ,population                            INTEGER 
  ,population_density                    NUMERIC(9,3)
  ,median_age                            NUMERIC(4,1)
  ,aged_65_older                         NUMERIC(6,3)
  ,aged_70_older                         NUMERIC(6,3)
  ,gdp_per_capita                        NUMERIC(10,3)
  ,extreme_poverty                       NUMERIC(4,1)
  ,cardiovasc_death_rate                 NUMERIC(7,3)
  ,diabetes_prevalence                   NUMERIC(5,2)
  ,female_smokers                        NUMERIC(5,3)
  ,male_smokers                          NUMERIC(6,3)
  ,handwashing_facilities                NUMERIC(6,3)
  ,hospital_beds_per_thousand            NUMERIC(5,3)
  ,life_expectancy                       NUMERIC(5,2)
  ,human_development_index               NUMERIC(5,3)
  ,excess_mortality                      VARCHAR(30)
);
